INSERT INTO `settings` (`SettingsId`, `InstituteName`, `InstituteSlogan`, `InstituteEstablished`, `InstituteEIIN`, `InstituteIsMPO`, `InstituteLogo`, `InstituteHeader`, `InstitutePhone`, `InstituteEmail`, `InstituteAddress`, `InstituteWebsite`, `InstituteKeywords`, `InstituteTime`, `InstituteGoogleMaps`, `ShortInformation`, `AdminName`, `AdminPhone`, `AdminEmail`, `AdminPhoto`, `AdminSign`, `AdminMessage`, `AdminMessagePhoto`, `SelectedTheme`, `InstituteName_en`, `InstituteEIIN_en`, `InstituteAddress_en`) VALUES
(1, 'রামপুর উচ্চ বিদ্যালয় ', 'শিক্ষা জাতির মেরুদন্ড', '১৯৮৪', '১১৪৩০৮ ', '', 'Logo.png', '', '000000000000', 'info@demo.edu.bd', 'গ্রাম - রামপুর , থানা - কালিহাতী, জেলা -টাঙ্গাইল', 'http://www.institute.edu.bd', 'http://www.tritiyo.com', '9:00AM to 5:00 PM', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m10!1m8!1m3!1d3629.5725033535746!2d89.9839227!3d24.5348707!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sbd!4v1437993374527\" allowfullscreen></iframe>', 'টাঙ্গাইল জেলার কালিহাতী উপজেলায় গ্রামীন পরিবেশে অবস্থিত রামপুর উচচ বিদ্যালয় অত্র এলাকায় শিক্ষার দ্বার উম্মোচিত করেছে। শিক্ষার্থীদের মধ্যে সুশিক্ষার বিস্তার ঘটাতে রামপুর উচচ বিদ্যালয়টি সর্বদা সচেষ্ট।বুদ্ধিবৃত্তি, চর্চা ও জ্ঞানের পরিধি বাড়াতে এবং সুন্দর ও গঠনমুলক ভবিষ্যৎ নির্মানের মানসে ইতিমধ্যে যারা মাধ্যমিক পর্যায়ের গন্ডি পেরিয়ে উচচ শিক্ষায় অবতীর্ণ হয়েছে তাদের জানাই প্রাণঢালা অভিনন্দন। ছাত্র-ছাত্রীর জন্য বিদ্যালয়ের নির্ধারিত পোষাক , নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্ন করার জন্য সহপাঠ্যক্রমিক কার্যক্রম, গ্রন্থগার ব্যবহার বাধ্যতামুলক , শৃঙ্খলাবোধ, দেশপ্রেমিক যোগ্য নাগরিক গড়ে তুলতে দক্ষ, অভিজ্ঞ ও প্রশিক্ষন প্রাপ্ত শিক্ষক মন্ডলীর নিরলস প্রচেষ্টা , পাঠোন্ন্যনে মনিট্রিং , শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করণে কর্মচারীদের একাগ্রতা ও পরিচ্ছন্ন ও নিরিবিলি পরিবেশ বিদ্যালয়টির বিশেষ বৈশিষ্ট্য।', 'মীর কামরুজ্জামান', '৮৮০-১৭১২ ৫২৪৫৯৬', 'bolbolibegum123.gmail.com', 'headsir.jpg', 'headsir.jpg', ' শিক্ষার জ্ঞান মনের প্রসার জীবন ও পৃথিবী সম্বন্ধে নতুন চিন্তার উদ্ভাবন ঘটায়। আর শিক্ষা জাতির মেরুদন্ড হয়ে দাড়ায় তখনই, যখন একটি জাতি মানবীয় মুল্যবোধের উজ্জীবিত হয়ে শিক্ষাবান্দাব স্থিতিশীল সমাজ ও কার্যকার রাষ্ট্র প্রতিষ্টার মাধ্যমে উন্নত থেকে উন্ন্তর ভবিষ্যৎ নির্মাণে&nbsp; চেষ্টিত হয় ।আর এজন্য প্রয়োজন সুশিক্ষা । জ্ঞান অর্জনের সুশিক্ষার কোন বিকল্প নেই ।আমাদের উচিত সুশিক্ষার মাধ্যমে নীতিনৈতিকতা ও বিচার বুদ্ধিবোধকে জাগ্রত করে দেশাত্মবোধের চেতনায় উজ্জীবিত হয়ে নিজেকে সুনাগরিক হিসাবে গড়ে তোলার লক্ষে সঠিকভাবে কর্মকে নিয়ন্ত্রিত করা।<br>টাঙ্গাইল জেলার কালিহাতী উপজেলায় গ্রামীন পরিবেশে অবস্থিত রামপুর উচচ বিদ্যালয় অত্র এলাকায় শিক্ষার দ্বার উম্মোচিত করেছে। শিক্ষার্থীদের মধ্যে সুশিক্ষার বিস্তার ঘটাতে রামপুর উচচ বিদ্যালয়টি সর্বদা সচেষ্ট।বুদ্ধিবৃত্তি, চর্চা ও জ্ঞানের পরিধি বাড়াতে এবং সুন্দর ও গঠনমুলক ভবিষ্যৎ নির্মানের মানসে ইতিমধ্যে যারা মাধ্যমিক পর্যায়ের গন্ডি পেরিয়ে উচচ শিক্ষায় অবতীর্ণ হয়েছে তাদের জানাই প্রাণঢালা অভিনন্দন।<br>ছাত্র-ছাত্রীর জন্য বিদ্যালয়ের নির্ধারিত পোষাক , নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্ন করার জন্য সহপাঠ্যক্রমিক কার্যক্রম, গ্রন্থগার ব্যবহার বাধ্যতামুলক , শৃঙ্খলাবোধ, দেশপ্রেমিক যোগ্য নাগরিক গড়ে তুলতে দক্ষ, অভিজ্ঞ ও প্রশিক্ষন প্রাপ্ত শিক্ষক মন্ডলীর নিরলস প্রচেষ্টা , পাঠোন্ন্যনে মনিট্রিং , শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করণে কর্মচারীদের একাগ্রতা ও পরিচ্ছন্ন ও নিরিবিলি পরিবেশ বিদ্যালয়টির বিশেষ বৈশিষ্ট্য।<br>শিক্ষার্থীদের মেধা ও মনের বিকাশে বিজ্ঞান ও দৃষ্টান্তভিত্তিক মানসম্মত শিক্ষা দানে তথা ইন্টারনেট ব্যবহার নিশ্চিত করণ এবং সংশ্লিষ্ট সকলের সহযোগিতায় ছাত্র-ছাত্রীদের নিরাপত্তা বিধানে বিদ্যালয় কর্তৃপক্ষ দৃঢ় প্রতিজ্ঞ।<br>পরিশেষে বিদ্যালয়টির সাফল্য ও উন্নতি কামনা করছি।', 'blankavatar.jpg', 'bluetheme', NULL, NULL, NULL);
