(55, 'ইতিহাস', 'history', NULL, 1, 4, 'টাঙ্গাইল জেলার কালিহাতী উপজেলায় গ্রামীন পরিবেশে অবস্থিত রামপুর উচচ বিদ্যালয় অত্র এলাকায় শিক্ষার দ্বার উম্মোচিত করেছে। শিক্ষার্থীদের মধ্যে সুশিক্ষার বিস্তার ঘটাতে রামপুর উচচ বিদ্যালয়টি সর্বদা সচেষ্ট।বুদ্ধিবৃত্তি, চর্চা ও জ্ঞানের পরিধি বাড়াতে এবং সুন্দর ও গঠনমুলক ভবিষ্যৎ নির্মানের মানসে ইতিমধ্যে যারা মাধ্যমিক পর্যায়ের গন্ডি পেরিয়ে উচচ শিক্ষায় অবতীর্ণ হয়েছে তাদের জানাই প্রাণঢালা অভিনন্দন। ছাত্র-ছাত্রীর জন্য বিদ্যালয়ের নির্ধারিত পোষাক , নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্ন করার জন্য সহপাঠ্যক্রমিক কার্যক্রম, গ্রন্থগার ব্যবহার বাধ্যতামুলক , শৃঙ্খলাবোধ, দেশপ্রেমিক যোগ্য নাগরিক গড়ে তুলতে দক্ষ, অভিজ্ঞ ও প্রশিক্ষন প্রাপ্ত শিক্ষক মন্ডলীর নিরলস প্রচেষ্টা , পাঠোন্ন্যনে মনিট্রিং , শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করণে কর্মচারীদের একাগ্রতা ও পরিচ্ছন্ন ও নিরিবিলি পরিবেশ বিদ্যালয়টির বিশেষ বৈশিষ্ট্য।', '1450401420', 0, 1, 1),
