(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 21, 0, '\r\nশিক্ষার জ্ঞান মনের প্রসার জীবন ও পৃথিবী সম্বন্ধে নতুন চিন্তার উদ্ভাবন ঘটায়। আর শিক্ষা জাতির মেরুদন্ড হয়ে দাড়ায় তখনই, যখন একটি জাতি মানবীয় মুল্যবোধের উজ্জীবিত হয়ে শিক্ষাবান্দাব স্থিতিশীল সমাজ ও কার্যকার রাষ্ট্র প্রতিষ্টার মাধ্যমে উন্নত থেকে উন্ন্তর ভবিষ্যৎ নির্মাণে  চেষ্টিত হয় ।আর এজন্য প্রয়োজন সুশিক্ষা । জ্ঞান অর্জনের সুশিক্ষার কোন বিকল্প নেই ।আমাদের উচিত সুশিক্ষার মাধ্যমে নীতিনৈতিকতা ও বিচার বুদ্ধিবোধকে জাগ্রত করে দেশাত্মবোধের চেতনায় উজ্জীবিত হয়ে নিজেকে সুনাগরিক হিসাবে গড়ে তোলার লক্ষে সঠিকভাবে কর্মকে নিয়ন্ত্রিত করা।\r\nটাঙ্গাইল জেলার কালিহাতী উপজেলায় গ্রামীন পরিবেশে অবস্থিত রামপুর উচচ বিদ্যালয় অত্র এলাকায় শিক্ষার দ্বার উম্মোচিত করেছে। শিক্ষার্থীদের মধ্যে সুশিক্ষার বিস্তার ঘটাতে রামপুর উচচ বিদ্যালয়টি সর্বদা সচেষ্ট।বুদ্ধিবৃত্তি, চর্চা ও জ্ঞানের পরিধি বাড়াতে এবং সুন্দর ও গঠনমুলক ভবিষ্যৎ নির্মানের মানসে ইতিমধ্যে যারা মাধ্যমিক পর্যায়ের গন্ডি পেরিয়ে উচচ শিক্ষায় অবতীর্ণ হয়েছে তাদের জানাই প্রাণঢালা অভিনন্দন।\r\nছাত্র-ছাত্রীর জন্য বিদ্যালয়ের নির্ধারিত পোষাক , নির্দিষ্ট সময়ে পাঠদান ও পরীক্ষা সম্পন্ন করার জন্য সহপাঠ্যক্রমিক কার্যক্রম, গ্রন্থগার ব্যবহার বাধ্যতামুলক , শৃঙ্খলাবোধ, দেশপ্রেমিক যোগ্য নাগরিক গড়ে তুলতে দক্ষ, অভিজ্ঞ ও প্রশিক্ষন প্রাপ্ত শিক্ষক মন্ডলীর নিরলস প্রচেষ্টা , পাঠোন্ন্যনে মনিট্রিং , শিক্ষার্থীদের দাপ্তরিক কার্যক্রম সহজতর করণে কর্মচারীদের একাগ্রতা ও পরিচ্ছন্ন ও নিরিবিলি পরিবেশ বিদ্যালয়টির বিশেষ বৈশিষ্ট্য।\r\nশিক্ষার্থীদের মেধা ও মনের বিকাশে বিজ্ঞান ও দৃষ্টান্তভিত্তিক মানসম্মত শিক্ষা দানে তথা ইন্টারনেট ব্যবহার নিশ্চিত করণ এবং সংশ্লিষ্ট সকলের সহযোগিতায় ছাত্র-ছাত্রীদের নিরাপত্তা বিধানে বিদ্যালয় কর্তৃপক্ষ দৃঢ় প্রতিজ্ঞ।\r\nপরিশেষে বিদ্যালয়টির সাফল্য ও উন্নতি কামনা করছি।\r\n\r\n', '1450938847', 0, 1, 1),
